(function(amplify, _, undefined) {

    var randomFromTo = function(from, to){
       return Math.floor(Math.random() * (to - from + 1) + from);
    };
   var previousMid;
   //Publish a new price every second for each market
   setInterval(function() {
       var now = new Date();
       var currentMinute = now.getMinutes();
       var currentBar = _(mockData.PriceHistory).filter(function(bar){
           return CIAPI.parseDate(bar.BarDate).getMinutes() === currentMinute;
       });
       if (currentBar.length===0) { currentBar.push(mockData.PriceHistory[0]) }

       var mid = randomFromTo(currentBar[0].Low * 10000, currentBar[0].High * 10000)/10000;
       var bid = mid * 0.99;
       var offer = mid * 1.01;

       var change = 0;
       if (previousMid) {
           change = mid - previousMid;
       }
       previousMid = mid;

       _(mockData.CfdMarkets).each(function(market) {
          amplify.publish( "PRICE."+market.MarketId, new CIAPI.dto.PriceDTO(market.MarketId, now, bid, offer, change));
       });
   }, 1000);

   amplify.request.define( "createSession", function(settings) {
       console.log("Mocking response for CreateSession request", settings.data);

       if (settings.data.UserName === "causeError-timeout")  {
          console.log("mocking error 503 - pretending no response is received from the server", settings.data);
          settings.error(new CIAPI.dto.ApiErrorResponseDTO(503, 503, "Server timeout"));
       }
       else
       if (settings.data.UserName === "causeError-500")  {
          console.log("mocking error 500", settings.data);
          settings.error(new CIAPI.dto.ApiErrorResponseDTO(500, 500, "Server error"));
       }
       else
       {
           var matchingUsers = _(mockData.Users).filter(function(user) {
                return user.UserName === settings.data.UserName && user.Password === settings.data.Password;
           });
           if (matchingUsers.length > 0) {
               settings.success(new CIAPI.dto.CreateSessionResponseDTO(matchingUsers[0].Session));
           } else {
               settings.error(new CIAPI.dto.ApiErrorResponseDTO(401, 4010, "The credentials used to authenticate are invalid. Either the username, password or both are incorrect."));
           }
       }
   });

   amplify.request.define("DeleteSession", function(settings) {
       console.log("Mocking response for DeleteSession request", settings.data); 
       
       //Can this ever error?
       settings.success();
   });

   amplify.request.define( "ListCfdMarkets", function(settings) {
        console.log("Mocking response for ListCfdMarkets request", settings.data);
        var regex = new RegExp(settings.data.searchByMarketName+".*");
        var markets = _(mockData.CfdMarkets).filter(function(m) {
           return regex.test(m.Name);
        });
       settings.success(new CIAPI.dto.ListCfdMarketsResponseDTO(markets));
   });

   amplify.request.define( "GetPriceBars", function(settings) {
        console.log("Mocking response for GetPriceBars request", settings.data);
        settings.success(mockData.PriceHistory.slice(0, settings.data.maxResults));
   });

})(amplify, _);